	"BasicScatter": [
		{
			"file": "BasicScatter.js",
			"content": "import React, { Component } from 'react';\r\nimport { Cartesian, Panel } from '@extjs/reactor/modern';\r\nimport createData from './createData';\r\nimport ChartToolbar from '../Charts/ChartToolbar';\r\n\r\nExt.require([\r\n    'Ext.chart.*',\r\n    'Ext.chart.series.Scatter',\r\n    'Ext.chart.axis.Numeric',\r\n    'Ext.chart.axis.Category'\r\n]);\r\n\r\nexport default class BasicScatterChartExample extends Component {\r\n    \r\n    constructor() {\r\n        super();\r\n        this.refresh();\r\n    }\r\n\r\n    store = Ext.create('Ext.data.Store', {\r\n        fields: ['id', 'g0', 'g1', 'g2', 'g3', 'g4', 'g5', 'g6', 'name']\r\n    });\r\n\r\n    state = {\r\n        theme: 'default'\r\n    };\r\n\r\n    refresh = () => {\r\n        this.store.loadData(createData(25));\r\n    }\r\n\r\n    toggleZoomOnPan = (zoomOnPan) => {\r\n        this.refs.chart.getInteraction('panzoom').setZoomOnPan(zoomOnPan);\r\n    }\r\n\r\n    changeTheme = (select, choice) => {\r\n        this.setState({ theme: choice.get('value') })\r\n    }\r\n\r\n    render() {\r\n        const { theme } = this.state;\r\n\r\n        return (\r\n            <Panel shadow layout=\"fit\">\r\n                <ChartToolbar\r\n                    onRefreshClick={this.refresh}\r\n                    onToggleZoomOnPan={this.toggleZoomOnPan}\r\n                    onThemeChange={this.changeTheme}\r\n                    theme={theme}\r\n                />\r\n                <Cartesian\r\n                    ref=\"chart\"\r\n                    insetPadding=\"20 20 10 10\"\r\n                    store={this.store}\r\n                    theme={theme}\r\n                    legend={{\r\n                        position: 'bottom'\r\n                    }}\r\n                    interactions={[\r\n                        'panzoom',\r\n                        'itemhighlight'\r\n                    ]}\r\n                    series={[{\r\n                        type: 'scatter',\r\n                        xField: 'id',\r\n                        yField: 'g1',\r\n                        title: 'Group 1',\r\n                        highlightCfg: {\r\n                            strokeStyle: 'red',\r\n                            lineWidth: 5\r\n                        },\r\n                        marker: {\r\n                            type: 'path',\r\n                            path: [\r\n                                ['M', 0, 1],\r\n                                ['L', 1, 0],\r\n                                ['L', 0, -1],\r\n                                ['L', -1, 0],\r\n                                ['Z']\r\n                            ],\r\n                            scale: 10,\r\n                            lineWidth: 2\r\n                        }\r\n                    }, {\r\n                        type: 'scatter',\r\n                        xField: 'id',\r\n                        yField: 'g2',\r\n                        title: 'Group 2',\r\n                        highlightCfg: {\r\n                            strokeStyle: 'red',\r\n                            lineWidth: 5\r\n                        },\r\n                        marker: {\r\n                            type: 'circle',\r\n                            radius: 10,\r\n                            lineWidth: 2\r\n                        }\r\n                    }]}\r\n                    axes={[{\r\n                        type: 'numeric',\r\n                        position: 'left',\r\n                        fields: ['g1', 'g2', 'g3', 'g4'],\r\n                        visibleRange: [0, 1],\r\n                        style: {\r\n                            estStepSize: 20\r\n                        },\r\n                        label: {\r\n                            rotate: {\r\n                                degrees: -30\r\n                            }\r\n                        }\r\n                    }, {\r\n                        type: 'category',\r\n                        position: 'bottom',\r\n                        visibleRange: [0, 0.5],\r\n                        fields: 'id'\r\n                    }]}\r\n                />\r\n            </Panel>\r\n        )\r\n    }\r\n}"
		},
		{
			"file": "createData.js",
			"content": "let seed = 1.3;\r\n\r\n// Controllable random.\r\nfunction random() {\r\n    seed *= 7.3;\r\n    seed -= Math.floor(seed);\r\n    return seed;\r\n}\r\n\r\nexport default function createData(numRecords) {\r\n    let data = [],\r\n        record = {\r\n            id: 0,\r\n            g0: 300,\r\n            g1: 700 * random() + 100,\r\n            g2: 700 * random() + 100,\r\n            g3: 700 * random() + 100,\r\n            g4: 700 * random() + 100,\r\n            g5: 700 * random() + 100,\r\n            g6: 700 * random() + 100,\r\n            name: 'Item-0'\r\n        }, \r\n        i;\r\n\r\n    data.push(record);\r\n\r\n    for (i = 1; i < numRecords; i++) {\r\n        record = {\r\n            id: i,\r\n            g0: record.g0 + 30 * random(),\r\n            g1: Math.abs(record.g1 + 300 * random() - 140),\r\n            g2: Math.abs(record.g2 + 300 * random() - 140),\r\n            g3: Math.abs(record.g3 + 300 * random() - 140),\r\n            g4: Math.abs(record.g4 + 300 * random() - 140),\r\n            g5: Math.abs(record.g5 + 300 * random() - 140),\r\n            g6: Math.abs(record.g6 + 300 * random() - 140),\r\n            name: 'Item-' + i\r\n        };\r\n        data.push(record);\r\n    }\r\n\r\n    return data;\r\n}\r\n"
		}
	],
